h.    \r\n','2020-12-07 00:00:00',NULL,NULL,'hp-ink-tank-wireless-415-all-in-one','','',NULL,1,'2020-12-07 12:20:46.218732','2020-12-07 12:35:32.088911',0,''),(4,'HP DeskJet 1115 Ink Advantage','','2020-12-07 00:00:00',NULL,NULL,'hp-deskjet-1115-ink-advantage','','',NULL,1,'2020-12-07 12:45:28.408399','2020-12-07 12:49:41.278718',0,''),(5,'ASUS Notebook X441MA','Laptop ASUS X441 Series dirancang untuk memberi Anda pengalaman yang benar-benar imersif pengalaman multimedia. Didukung oleh prosesor Celeron®, grafis Intel HD, dan eksklusif Audio SonicMaster yang menggabungkan teknologi ICEpower.','2020-12-07 00:00:00',NULL,NULL,'asus-notebook-x441ma','','',NULL,1,'2020-12-07 13:23:01.742056','2020-12-07 14:41:23.329717',0,''),(6,'ASUS TUF Gaming A15','Ditujukan untuk bermain game yang serius dengan durabilitas ekstra, TUF Gaming A15 adalah laptop gaming Windows 10 Home yang dapat membawa Anda menuju kemenangan. Didukung oleh AMD Ryzen™ 7 4800 Series CPU dan GeForce RTX™ 2060 GPU terbaru, gameplay penuh aksi cepat, lancar, dan layar IPS-level dengan refresh rate hingga 144Hz. Meskipun memiliki sasis yang lebih kecil dan lebih portabel dari pendahulunya, laptop gaming ini juga dilengkapi baterai 48Wh yang lebih besar untuk masa pakai baterai yang superior. Pendinginan pembersihan-diri yang efisien bergabung dengan daya tahan kelas-militer TUF yang khas untuk menjadikan pejuang jalanan yang teruji pertempuran ini sebagai sekutu yang andal bagi para gamer saat bepergian.',NULL,NULL,NULL,'asus-tuf-gaming-a15','','',NULL,1,'2020-12-07 14:20:52.671290','2020-12-07 14:31:59.371202',0,''),(7,'ASUS VivoBook 14 X412FA','Baik di tempat kerja atau bermain, ASUS VivoBook Ultra A412 adalah laptop ringkas yang dapat membantu dalam apa pun yang Anda inginkan. Layar NanoEdge empat sisi tanpa bingkai yang baru menawarkan bezel ultraslim 5.7mm, memberikan rasio layar-ke-tubuh 87% yang luar biasa untuk visual yang sangat mendalam. Desain engsel ErgoLift yang baru juga memiringkan keyboard agar mengetik lebih nyaman. ASUS VivoBook Ultra A412 ditenagai oleh prosesor Intel® Core™ i5 terbaru untuk membantu Anda menyelesaikan berbagai hal dengan sedikit keributan. Terlebih lagi, tersedia dalam empat sentuhan unik yang sesuai dengan gaya Anda.','2020-12-07 00:00:00',NULL,NULL,'asus-vivobook-14-x412fa','','',NULL,1,'2020-12-07 14:37:04.773086','2020-12-07 14:56:17.620752',1,''),(8,'Acer Aspire 3 A314-32 ','Acer Aspire 3 A314-32 memiliki antena kuat untuk Wireless 802.11ac, dan juga jaga mata Anda dari blue light dengan teknologi BlueLightShield.','2020-12-13 00:00:00',NULL,NULL,'acer-aspire-3-a314-32','','',NULL,1,'2020-12-13 02:55:51.786810','2020-12-13 03:04:19.884687',0,''),(9,'ACER Swift 3 SF314-41','AMD Ryzen 5 (3500U, 2.10 GHz, 4 MB) - 35.6 cm (14\") LED - 16:9 Full HD - LCD - ComfyView - AMD Radeon™ Vega 8 - 8 GB DDR4 SDRAM - No - Colour Sparkly Silver - Weight (Approximate) 1.50 kg','2020-12-13 00:00:00',NULL,NULL,'acer-swift-3-sf314-41','','',NULL,1,'2020-12-13 03:07:37.192624','2020-12-13 03:21:10.968219',0,''),(10,'Keyboard Logitech K120','Desain\r\nDidesain dengan baik agar setiap tumpahan cairan akan mengalir keluar dari keyboard menjaga keybord Anda dari kerusakan karena air yang tidak Anda inginkan, Keyboard ini memiliki desain tipis yang memberi kesan terlihat ramt perhatian dan bentuk ini memberi Anda kenyaman yang lebih dari sebelumnya.\r\n\r\nKey Berkualitas Tinggi\r\nSetiap Key yang terdapat pada keyboard ini bertahan hingga 10 juta keystrokes, sehingga Anda dapat tetap mengetik keyboard ini untuk jangka waktu yang sangat lama.\r\n\r\nBentuk Kokoh\r\nAnda dapat mengatur kaki penopang meningkatkan kemiringan keyboard sampai dengan 8 derajat untuk memenuhi kebutuhan pribadi Anda akan keergonomisan.\r\n\r\nKoneksi Universal\r\nPengoprasian yang sederhana, Anda cukup tancapkan ujung nya ke port USB pada komputer desktop, laptop atau netbook Anda dan langsung memulai menikmati keyboard berkualitas ini, keyboard ini kompatibel dengan: Windows XP, Windows Vista atau Windows 7 ,Linux kernel 2.6+.','2020-12-13 00:00:00',NULL,NULL,'keyboard-logitech-k120','','',NULL,1,'2020-12-13 03:25:14.534294','2020-12-13 03:30:32.347725',1,''),(11,'Mechanical Keyboard Gaming RGB Backlight True Mechanic With Numeric','Deskripsi Mechanical Keyboard Gaming RGB Backlight True Mechanic With Numeric, menemani dan melengkapi kegiatan gaming Anda dengan warna yang dapat diubah-ubah sesuai keinginan Anda.','2020-12-13 00:00:00',NULL,NULL,'mechanical-keyboard-gaming-rgb-backlight-true-mechanic-with-numeric','','',NULL,1,'2020-12-13 03:34:23.980008','2020-12-13 03:43:32.595928',1,''),(12,'Fantech Keyboard Mechanical Maxcore MK852 ','LIMITED STOCK SPACE EDITION UNTUK PARA #CALONJUARA','2020-12-13 00:00:00',NULL,NULL,'fantech-keyboard-mechanical-maxcore-mk852','','',NULL,1,'2020-12-13 09:24:52.688747','2020-12-13 09:35:32.983004',0,''),(13,'Keyboard Wireless + Touchpad','# Keyboard Wireless koneksi menggunakan USB Reciever (sudah termasuk USB Receiver)\r\n\r\nKeyboard dengan standar Qwerty dan dilengkapi dengan touchpad untuk memudahkan Anda mengontrol mouse pada operatins sistem Windows. Cocok untuk mengontrol komputer, smartphone dan smart TV.\r\n\r\n#FItur\r\nMultifunction Keyboard\r\nSelain berfungsi sebagai keyboard juga berfungsi sebagai media kontrol dan mouse. Dilengkapi dengan tombol media seperti play, stop, fast forward, mute, dll. Fungsi touchpad untuk menggerak mouse pada layar TV Anda.\r\n\r\nDesign\r\nDesign keyboard sangat kecil dan ringan. Mudah untuk digunakan sebagai remote smart TV untuk ruang tamu Anda.\r\n\r\nWireless Keyboard\r\nDengan fungsi wireless Anda lebih leluasa mengontrol device Anda dari jarak jauh hingga jarak maksimal 10 meter.\r\n\r\nCompability\r\nProduk ini dapat digunakan untuk banyak device seperti komputer, smartphone android, laptop dan smart TV.\r\nPackage Contents','2020-12-13 00:00:00',NULL,NULL,'keyboard-wireless-touchpad','','',NULL,1,'2020-12-13 09:40:12.393335','2020-12-13 09:45:14.79977